/** @jsxImportSource @emotion/react */
import styled from '@emotion/styled'
import React from 'react'
import { BrowserRouter as Router, Link } from 'react-router-dom'
import Button from '@mui/material/Button'
import leaderboard from '../icons/leaderboard_black_24dp.svg'
import credit from '../icons/credit_score_black_24dp.svg'
import trend from '../icons/trending_up_black_24dp.svg'

const mobile = `@media (max-width: 500px)`

const SignupContainer = styled.div`
    max-width: 800px;
    ${mobile} {
        max-width: 500px;
    }
`

const IconContainer = styled.div`
    max-width: 800px;
    display: flex;
    ${mobile} {
        max-width: 500px;
    }
`

const VerticalBlackLine = styled.hr`
    width: 100%;
    color: black;
    transform: rotate(180deg);
`

const DashImage = styled.img`
    width: 300px;
    height: 320px;
`

function LandingPage() {
    return (
        <div style={{ display: 'flex' }}>
            <h1>DAYTRADER.COM</h1>
            <h3>Buy, Sell, Trade!</h3>
            <IconContainer>
                <DashImage src={leaderboard}>leaderboard</DashImage>
                <DashImage src={credit}>trending_up</DashImage>
                <DashImage src={trend}>credit_score</DashImage>
            </IconContainer>

            <SignupContainer>
                <Button variant="contained">Sign Up</Button>
                <Button variant="contained">Sign In</Button>
            </SignupContainer>
            <VerticalBlackLine />
        </div>
    )
}

export default LandingPage
